(1, 120, 'Une bire naturelle qui surprend par ses armes tropicaux.\n\nEnvie d\'une bire qui rappelle le sable chaud de la plage et la brise tropicale? Cette bire est tout indique. Compar  un vin blanc version malt par notre matre brasseur, la berliner se boit sous le soleil avec sa gang  l\'anne longue.\nBire surie par un processus naturel, cette berliner weisse dveloppe des armes surprenants de pamplemousse, d\'ananas et de fruit de la passion. Fidle au got du style, notre version de cette ale mythique allemande propose un taux d\'alcool rehauss. Ce classique indmodable est idal pour les #BRASSEURSDHIESTOIRES\n\nAutour d\'une BERLINER WEISSE les bonnes histoires SURPRENNENT', 'Une bire naturelle qui surprend par ses armes tropicaux.\n\nEnvie d\'une bire qui rappelle le sable chaud de la plage et la brise tropicale? Cette bire est tout indique. Compar  un vin blanc version malt par notre matre brasseur, la berliner se boit sous le soleil avec sa gang  l\'anne longue.\nBire surie par un processus naturel, cette berliner weisse dveloppe des armes surprenants de pamplemousse, d\'ananas et de fruit de la passion. Fidle au got du style, notre version de cette ale mythique allemande propose un taux d\'alcool rehauss. Ce classique indmodable est idal pour les #BRASSEURSDHIESTOIRES\n\nAutour d\'une BERLINER WEISSE les bonnes histoires SURPRENNENT', 1, '2023-10-31 10:02:00', '2023-10-31 10:02:00'),
(2, 121, 'Une bire forte et firement framboise.\n\nTu t\'ennuies de te faire pincer une joue par matante Ginette ? Voici ta chance de revivre tes souvenirs avec notre Berliner  la framboise. Suri naturellement, ce nectar vous chatouillera l\'intrieur des joues.\n\nBires sures et framboises ont toujours fait bon mnage. C\'est en y ajoutant une trle de dlicieuse framboises de notre belle rgion que nous en faisons notre dclinaison. Les fruits savoureux se marient avec l\'acidit de notre Berliner Weisse pour en faire un parfait quilibre. Levons nos verres  toutes les matantes et les #BRASSEURSDHISTOIRES\n\nAutour d\'une BERLINER WEISSE FRAMBOISE les bonnes anecdotes SE CUEILLENT.', 'Une bire forte et firement framboise.\n\nTu t\'ennuies de te faire pincer une joue par matante Ginette ? Voici ta chance de revivre tes souvenirs avec notre Berliner  la framboise. Suri naturellement, ce nectar vous chatouillera l\'intrieur des joues.\n\nBires sures et framboises ont toujours fait bon mnage. C\'est en y ajoutant une trle de dlicieuse framboises de notre belle rgion que nous en faisons notre dclinaison. Les fruits savoureux se marient avec l\'acidit de notre Berliner Weisse pour en faire un parfait quilibre. Levons nos verres  toutes les matantes et les #BRASSEURSDHISTOIRES\n\nAutour d\'une BERLINER WEISSE FRAMBOISE les bonnes anecdotes SE CUEILLENT.', 1, '2023-10-31 10:08:03', '2023-10-31 10:08:03'),
(3, 122, 'Une bire lgre forge dans l\'histoire de la classe ouvrire.\n\nDans la tradition brassicole anglaise, la bitter est la bire de soif des ouvriers. Avec le travail acharn qu\'on attendait des employs de la Price Brothers...  Alma, le monde, a avait soif!\n\nEt pour produire cette bitter, on n\'a pas chm! Notre version trouve l\'quilibre entre le caramel du malt Crystal et la finesse du houblon qubcois. Grce  son faible taux d\'alcool, cette ale rousse se prte  toutes vos occasions de fter tard... et de rentrer travailler le lendemain! Toutes les raisons sont bonnes pour devenir des #BRASSEURSDHISTOIRES\n\nAutour dune BITTER/ROUSSE les bonnes histoires SE FORGENT.', 'Une bire lgre forge dans l\'histoire de la classe ouvrire.\n\nDans la tradition brassicole anglaise, la bitter est la bire de soif des ouvriers. Avec le travail acharn qu\'on attendait des employs de la Price Brothers...  Alma, le monde, a avait soif!\n\nEt pour produire cette bitter, on n\'a pas chm! Notre version trouve l\'quilibre entre le caramel du malt Crystal et la finesse du houblon qubcois. Grce  son faible taux d\'alcool, cette ale rousse se prte  toutes vos occasions de fter tard... et de rentrer travailler le lendemain! Toutes les raisons sont bonnes pour devenir des #BRASSEURSDHISTOIRES\n\nAutour dune BITTER/ROUSSE les bonnes histoires SE FORGENT.', 1, '2023-10-31 10:29:53', '2023-10-31 10:29:53'),
(4, 123, 'Une bire naturelle qui rconforte par sa texture soyeuse.\n\nComme les fameux snowbirds du Qubec, notre blanche  la clmentine ramne du soleil; plein la bouche,  l\'hiver comme  l\'t. Elle vous offre un moment de ressourcement, plein d\'nergie et de confort.\nCette bire parat  la fois familire avec son got lger de pin et de fleur grce  la cardamome, et innovante par l\'inclusion de l\'agrume  mme la bire. Fermente avec notre levure belge en rsidence, cette blanche plutt sche laisse toute la place au parfum des clmentines dshydrates par la compagnie qubcoise Anhydra. Une collaboration pleine de fracheur entre #BRASSEURSDHISTOIRES\n\nAutour d\'une BLANCHE  LA CLMENTINE les bonnes histoires RCONFORTENT', 'Une bire naturelle qui rconforte par sa texture soyeuse.\n\nComme les fameux snowbirds du Qubec, notre blanche  la clmentine ramne du soleil; plein la bouche,  l\'hiver comme  l\'t. Elle vous offre un moment de ressourcement, plein d\'nergie et de confort.\nCette bire parat  la fois familire avec son got lger de pin et de fleur grce  la cardamome, et innovante par l\'inclusion de l\'agrume  mme la bire. Fermente avec notre levure belge en rsidence, cette blanche plutt sche laisse toute la place au parfum des clmentines dshydrates par la compagnie qubcoise Anhydra. Une collaboration pleine de fracheur entre #BRASSEURSDHISTOIRES\n\nAutour d\'une BLANCHE  LA CLMENTINE les bonnes histoires RCONFORTENT', 1, '2023-10-31 10:50:38', '2023-10-31 10:50:38'),
(5, 124, 'Une bire costaude qui multiplie ses houblons.\n\nSeb, noter matre brasseur, voulait sortir des sentiers battus avec sa version de la double IPA. Son assemblage de saveurs uniques rveillera vos papilles  coup sr. Cette bire vous fait voyager  chaque gorge avec ses houblons qui se multiplient.\n\nDes houblons de 5 nations sont utiliss dans notre double IPA 100% malt. Les saveurs typiques du grain anglais se mlangent  de puissants armes de fruits rouges et de citron. Vos papilles ont assez hibern, cest lheure de passer au printemps mes #BRASSEURSDHISTOIRES\n\nAutour d\'une DOUBLE IPA les bonnes histoires SE MULTIPLIENT.', 'Une bire costaude qui multiplie ses houblons.\n\nSeb, noter matre brasseur, voulait sortir des sentiers battus avec sa version de la double IPA. Son assemblage de saveurs uniques rveillera vos papilles  coup sr. Cette bire vous fait voyager  chaque gorge avec ses houblons qui se multiplient.\n\nDes houblons de 5 nations sont utiliss dans notre double IPA 100% malt. Les saveurs typiques du grain anglais se mlangent  de puissants armes de fruits rouges et de citron. Vos papilles ont assez hibern, cest lheure de passer au printemps mes #BRASSEURSDHISTOIRES\n\nAutour d\'une DOUBLE IPA les bonnes histoires SE MULTIPLIENT.', 1, '2023-10-31 10:53:49', '2023-10-31 10:53:49'),
(6, 125, 'Amateur de friandises sales, vous serez ravis par cette bire lgre de type allemend. L\'ajout d\'algues gaspsiennes lui confre une saveur unique avec des notes vgtales et iodes. Des armes de noisettes et de baies de genivre mettent en valeur le ct lactique et suret typique au style. Ds son ouverture, cette bire vous transportera en vacances   la mer en un instant!', 'Amateur de friandises sales, vous serez ravis par cette bire lgre de type allemend. L\'ajout d\'algues gaspsiennes lui confre une saveur unique avec des notes vgtales et iodes. Des armes de noisettes et de baies de genivre mettent en valeur le ct lactique et suret typique au style. Ds son ouverture, cette bire vous transportera en vacances   la mer en un instant!', 1, '2023-10-31 13:25:23', '2023-10-31 13:25:23'),
(7, 126, 'Voici l\'endroit ou l\'agrume rencontre le houblon. Mordante et florale, cette IPA sure a t labore en pleine canicule par l\'quipe de production pour tancher une soif collective. Et a marche!', 'Voici l\'endroit ou l\'agrume rencontre le houblon. Mordante et florale, cette IPA sure a t labore en pleine canicule par l\'quipe de production pour tancher une soif collective. Et a marche!', 1, '2023-10-31 13:27:37', '2023-10-31 13:27:37'),
(8, 127, 'Une bire amre o surfent les saveurs.\n\nAllons faire un tour sous le soleil de la cte ouest, a vous dit? Rsultat du  double dry-hopped  ( ou DDH pour les intimes ), notre IPA Pacifique inondera vos papilles d\'armes de citron de mandarine et de conifres.  chaque gorge, c\'est une vague de fracheur! \nNotre interprtation de la West Coast IPA vous mettra du houblon plein la bouche. Une fois qu\'on y tremp ses lvres, on ne peut plus s\'arrter. L\'utilisation d\'un malt 100% qubcois ajoute un got craquant et mielleux  ce raz-de-mare de houblons. Surfons sur cette vague de saveur.  l\'eau! #BRASSEURSDHISTOIRES\n\nAutour d\'une IPA PACIFIQUE les bonnes histoires SURFENT.', 'Une bire amre o surfent les saveurs.\n\nAllons faire un tour sous le soleil de la cte ouest, a vous dit? Rsultat du  double dry-hopped  ( ou DDH pour les intimes ), notre IPA Pacifique inondera vos papilles d\'armes de citron de mandarine et de conifres.  chaque gorge, c\'est une vague de fracheur! \nNotre interprtation de la West Coast IPA vous mettra du houblon plein la bouche. Une fois qu\'on y tremp ses lvres, on ne peut plus s\'arrter. L\'utilisation d\'un malt 100% qubcois ajoute un got craquant et mielleux  ce raz-de-mare de houblons. Surfons sur cette vague de saveur.  l\'eau! #BRASSEURSDHISTOIRES\n\nAutour d\'une IPA PACIFIQUE les bonnes histoires SURFENT.', 1, '2023-10-31 13:30:37', '2023-10-31 13:30:37'),
(9, 128, 'Faire dans la dentelle, en assemblant mticuleusement des ingrdients du terroir  des houblons aromatiques. Laisser les grains de la Malterie Caux-Laflamme exprimer leur ct croquant. Parfumer le tout de houblon Citra deux fois plutt qu\'une. Surtout, prendre le temps, celui de la fabriquer, mais avant tout, celui de la dguster.', 'Faire dans la dentelle, en assemblant mticuleusement des ingrdients du terroir  des houblons aromatiques. Laisser les grains de la Malterie Caux-Laflamme exprimer leur ct croquant. Parfumer le tout de houblon Citra deux fois plutt qu\'une. Surtout, prendre le temps, celui de la fabriquer, mais avant tout, celui de la dguster.', 1, '2023-10-31 13:36:04', '2023-10-31 13:36:04'),
(10, 129, 'Une bire houblonne qui fait voyager vos papilles.\n\nQuand je pars en voyage, j\'apporte... ma NEIPA. Moelleuse en bouche, ou se pointe une petite touche d\'amertume, cette bire vous fera voyager d\'un bord pis de l\'autre comme sa slection de houblons est volutive au choix de notre quipe de brassage.\n\nCette IPA se veut une rencontre entre le Qubec et le pays des Pats. Un simple \"pschitt\" et les armes tropicaux des houblons se font sentir. Un punch d\'amertume fruite dans un gant de velours. Parfaites  partager lors d\'une soire au coucher de soleil entre #BRASSEURSDHISTOIRES\n\nAutour d\'une NEIPA les bonnes histoires VOYAGENT.', 'Une bire houblonne qui fait voyager vos papilles.\n\nQuand je pars en voyage, j\'apporte... ma NEIPA. Moelleuse en bouche, ou se pointe une petite touche d\'amertume, cette bire vous fera voyager d\'un bord pis de l\'autre comme sa slection de houblons est volutive au choix de notre quipe de brassage.\n\nCette IPA se veut une rencontre entre le Qubec et le pays des Pats. Un simple \"pschitt\" et les armes tropicaux des houblons se font sentir. Un punch d\'amertume fruite dans un gant de velours. Parfaites  partager lors d\'une soire au coucher de soleil entre #BRASSEURSDHISTOIRES\n\nAutour d\'une NEIPA les bonnes histoires VOYAGENT.', 1, '2023-10-31 13:38:03', '2023-10-31 13:38:03'),
(11, 130, ' son got mielleux s\'ajoutent de subtiles touches boises et vanilles soutenues par une lgre amertume.', ' son got mielleux s\'ajoutent de subtiles touches boises et vanilles soutenues par une lgre amertume.', 1, '2023-10-31 13:39:21', '2023-10-31 13:39:21'),
(12, 131, 'Une bire naturelle qui gote le vrai.\n\nAlerte buvabilit : cette pilsner est rafrachissante  souhait! Bire au got franc, elle est digne des saveurs de notre terroir. Son style traditionnel europen reste bien de chez nous avec ses ingrdients 100% d\'ici.\n\nSes armes de pain frais, de miel et dherbes vous invitent  y plonger sans retenue. Au got, la crale croquante laisse les dlicats houblons exprimer leur signature. Le Saaz qubcois apporte une saveur florale et herbace. Cette pilsner rafrachira tous les vrais #BRASSEURSDHISTOIRES\n\nAutour d\'une PILSNER les bonnes anecdotes SONT HONNTES', 'Une bire naturelle qui gote le vrai.\n\nAlerte buvabilit : cette pilsner est rafrachissante  souhait! Bire au got franc, elle est digne des saveurs de notre terroir. Son style traditionnel europen reste bien de chez nous avec ses ingrdients 100% d\'ici.\n\nSes armes de pain frais, de miel et dherbes vous invitent  y plonger sans retenue. Au got, la crale croquante laisse les dlicats houblons exprimer leur signature. Le Saaz qubcois apporte une saveur florale et herbace. Cette pilsner rafrachira tous les vrais #BRASSEURSDHISTOIRES\n\nAutour d\'une PILSNER les bonnes anecdotes SONT HONNTES', 1, '2023-10-31 13:40:46', '2023-10-31 13:40:46'),
(13, 132, 'Une bire choco-bleute pour se rgaler. \n\nCe porter du terroir, c\'est notre hommage liquide  un classique de la rgion, le chocolat aux bleuets des Pres Trappistes. Issue d\'une collaboration avec Dieu du Ciel!, cette bire marie les saveurs du gru de cacao  des tonnes de bleuets du Lac-Saint-Jean. \n\nCette ale noire impressionne par sa mousse onctueuse aux reflets mauve. Intense et dlicate comme les gens du Lac, son got chocolat et fruit en fait un rgal pour accompagner les desserts des #BRASSEURSDHISTOIRES\n\nAutour d\'un PORTER CHOCO-BLEUETS  les bonnes anecdotes RGALENT.', 'Une bire choco-bleute pour se rgaler. \n\nCe porter du terroir, c\'est notre hommage liquide  un classique de la rgion, le chocolat aux bleuets des Pres Trappistes. Issue d\'une collaboration avec Dieu du Ciel!, cette bire marie les saveurs du gru de cacao  des tonnes de bleuets du Lac-Saint-Jean. \n\nCette ale noire impressionne par sa mousse onctueuse aux reflets mauve. Intense et dlicate comme les gens du Lac, son got chocolat et fruit en fait un rgal pour accompagner les desserts des #BRASSEURSDHISTOIRES\n\nAutour d\'un PORTER CHOCO-BLEUETS  les bonnes anecdotes RGALENT.', 1, '2023-10-31 13:42:25', '2023-10-31 13:42:25'),
(14, 133, 'Une bire lgre qui rafrachit par ses origines.\n\nLes \"sessions\" ont t cres durant la premire guerre mondiale alors que les travailleurs avaient droit  deux priodes de 4 heures pour tancher leur soif. Le faible taux d\'alcool du style permettait d\'en boire aisment avant de retourner au travail. \n\nC\'est la bire prfre de notre matre brasseur Seb, pour qui toute occasion est bonne pour s\'ouvrir une session IPA. L\'amertume tranchante de son houblon Centennial laisse surgir des armes de citron et de pamplemousse, la rendant rafrachissante  souhait. La bire dsigne pour tancher la soif des #BRASSEURSDHISTOIRES\n\nAutour d\'une SESSION IPA les bonnes histoires RAFRACHISSENT', 'Une bire lgre qui rafrachit par ses origines.\n\nLes \"sessions\" ont t cres durant la premire guerre mondiale alors que les travailleurs avaient droit  deux priodes de 4 heures pour tancher leur soif. Le faible taux d\'alcool du style permettait d\'en boire aisment avant de retourner au travail. \n\nC\'est la bire prfre de notre matre brasseur Seb, pour qui toute occasion est bonne pour s\'ouvrir une session IPA. L\'amertume tranchante de son houblon Centennial laisse surgir des armes de citron et de pamplemousse, la rendant rafrachissante  souhait. La bire dsigne pour tancher la soif des #BRASSEURSDHISTOIRES\n\nAutour d\'une SESSION IPA les bonnes histoires RAFRACHISSENT', 1, '2023-10-31 13:43:59', '2023-10-31 13:43:59'),
(15, 134, 'Une bire goteuse qui enrichit par ses notes onctueuses.\n\nFaisant partie des premires bires produites  la microbrasserie, le stout est un des styles prfrs de Seb, notre matre brasseur.  l\'oppos de ses semblables, notre version est lgre et se laisse descendre (les unes aprs les autres).\n\nLa Microbrasserie Riverbend lve son verre aux Irlandais en brassant un stout. Onctueuse et balance, cette bire aux notes de caf et de chocolat traverse le temps jusqu\'au #BRASEURSDHISTOIRES\n\nAutour d\'un STOUT les bonnes histoires ENRICHISSENT', 'Une bire goteuse qui enrichit par ses notes onctueuses.\n\nFaisant partie des premires bires produites  la microbrasserie, le stout est un des styles prfrs de Seb, notre matre brasseur.  l\'oppos de ses semblables, notre version est lgre et se laisse descendre (les unes aprs les autres).\n\nLa Microbrasserie Riverbend lve son verre aux Irlandais en brassant un stout. Onctueuse et balance, cette bire aux notes de caf et de chocolat traverse le temps jusqu\'au #BRASEURSDHISTOIRES\n\nAutour d\'un STOUT les bonnes histoires ENRICHISSENT', 1, '2023-10-31 13:46:07', '2023-10-31 13:46:07'),
(16, 135, 'Une bire frache faite pour tre partage.\n\nChez Riverbend, quand on ouvre nos conglateurs, des fois on a des surprises... Quel bonheur de (re)dcouvrir un inventaire d\'argousiers pour le bonheur de nos clients. Cette bire inspire de notre gamme de Berliner Weisse, mais avec sa \"twist\", vous permettra un retour  la terre.\n\nLgrement acidule et d\'une couleur orange, la Sure  l\'Argousier est reconnue pour son parfum et sa fracheur uniques. Ces attributs en font la bire de prdilection  se partager autour d\'un pique-nique de #BRASSEURSDHISTOIRES\n\nAutour d\'une SURE  L\'ARGOUSIER les bonnes anecdotes SE PARTAGENT.', 'Une bire frache faite pour tre partage.\n\nChez Riverbend, quand on ouvre nos conglateurs, des fois on a des surprises... Quel bonheur de (re)dcouvrir un inventaire d\'argousiers pour le bonheur de nos clients. Cette bire inspire de notre gamme de Berliner Weisse, mais avec sa \"twist\", vous permettra un retour  la terre.\n\nLgrement acidule et d\'une couleur orange, la Sure  l\'Argousier est reconnue pour son parfum et sa fracheur uniques. Ces attributs en font la bire de prdilection  se partager autour d\'un pique-nique de #BRASSEURSDHISTOIRES\n\nAutour d\'une SURE  L\'ARGOUSIER les bonnes anecdotes SE PARTAGENT.', 1, '2023-10-31 13:50:09', '2023-10-31 13:50:09'),
(17, 136, 'Une bire extra-forte pour se rchauffer l\'intrieur.\n\nChez Riverbend, on fait souvent des bires faibles en alcool. En dbut d\'automne, c\'est le temps du vin d\'orge, et son haut pourcentage d\'alcool en surprend plus d\'un en passant par nos employs. Quand a arrive, cette personne se mrite le gentil sobriquet de \"Colonel Vin d\'Orge\".\n\nCe vin dorge 100% malt est brass dans la pure tradition du style pour vous rchauffer comme sur le bord d\'un feu de camp. Un compagnon robuste pour braver le froid du pays des #BRASSEURSDHISTOIRES.\n\nAutour d\'un VIN D\'ORGE les bonnes histoires RCHAUFFENT.', 'Une bire extra-forte pour se rchauffer l\'intrieur.\n\nChez Riverbend, on fait souvent des bires faibles en alcool. En dbut d\'automne, c\'est le temps du vin d\'orge, et son haut pourcentage d\'alcool en surprend plus d\'un en passant par nos employs. Quand a arrive, cette personne se mrite le gentil sobriquet de \"Colonel Vin d\'Orge\".\n\nCe vin dorge 100% malt est brass dans la pure tradition du style pour vous rchauffer comme sur le bord d\'un feu de camp. Un compagnon robuste pour braver le froid du pays des #BRASSEURSDHISTOIRES.\n\nAutour d\'un VIN D\'ORGE les bonnes histoires RCHAUFFENT.', 1, '2023-10-31 13:52:47', '2023-10-31 13:52:47'),
