(120, 239, 'Il ny a pas de houblon Tahoma dans cette bire! En fait, aprs avoir fait des tests avec ce houblon, loi, le matre brasseur, tait si peu convaincu quil a dcid de brasser cette Pale ale fermire avec tout, sauf du Tahoma Le nom tait chouette par contre, donc pourquoi pas une  no tahoma ?', 'Il ny a pas de houblon Tahoma dans cette bire! En fait, aprs avoir fait des tests avec ce houblon, loi, le matre brasseur, tait si peu convaincu quil a dcid de brasser cette Pale ale fermire avec tout, sauf du Tahoma Le nom tait chouette par contre, donc pourquoi pas une  no tahoma ?', 1, '2023-11-03 15:07:54', '2023-11-03 15:07:54'),
