(150, 269, 'Ale blonde aux fins armes de pousses de sapin cueillis le 29 fvrier, jour exclusif de son brassage.', 'Ale blonde aux fins armes de pousses de sapin cueillis le 29 fvrier, jour exclusif de son brassage.', 1, '2023-11-07 09:58:03', '2023-11-07 09:58:03'),
(151, 270, 'Blanche trs ple lgrement voile, coiffe dune fine mousse blanche.\n\nAu nez armes dagrume et de pain, avec une lgre note pice provenant des herbes borales utilises dont le th du labrador et larmoise. \n\nEn bouche cest une sensation de grande fracheur qui prends place du  Lquilibre entre pices et crales.  Trs dsaltrante', 'Blanche trs ple lgrement voile, coiffe dune fine mousse blanche.\n\nAu nez armes dagrume et de pain, avec une lgre note pice provenant des herbes borales utilises dont le th du labrador et larmoise. \n\nEn bouche cest une sensation de grande fracheur qui prends place du  Lquilibre entre pices et crales.  Trs dsaltrante', 1, '2023-11-07 10:01:18', '2023-11-07 10:01:18'),
(152, 271, 'Comme le boutefeu qui allume sa mche, notre rousse a tout ce quil faut pour faire exploser vos papilles! Mousse tenace, reflets rougeoyants et finale torrfie.', 'Comme le boutefeu qui allume sa mche, notre rousse a tout ce quil faut pour faire exploser vos papilles! Mousse tenace, reflets rougeoyants et finale torrfie.', 1, '2023-11-07 10:05:38', '2023-11-07 10:05:38'),
(153, 272, 'Biere sure  l\'argousier', 'Biere sure  l\'argousier', 1, '2023-11-07 10:08:53', '2023-11-07 10:08:53'),
(154, 273, 'Vous reconnatrez facilement ce barley wine amricain  sa teinte cuivre et  sa rondeur liquoreuse. En bouche, la Frappabord vous sduira par son amertume marque, ses puissantes notes cralires et son arrire-got de sirop drable et de sucre dorge.\n*mdaille dor, Grands prix canadiens de la bire, 2011', 'Vous reconnatrez facilement ce barley wine amricain  sa teinte cuivre et  sa rondeur liquoreuse. En bouche, la Frappabord vous sduira par son amertume marque, ses puissantes notes cralires et son arrire-got de sirop drable et de sucre dorge.\n*mdaille dor, Grands prix canadiens de la bire, 2011', 1, '2023-11-07 10:10:20', '2023-11-07 10:10:20'),
(155, 274, 'Lager\nSous une allure de blondinette,  se cache une bombe darmes mettant en vedette le th de Tawan et le poivre, une dlicate sensation de picotement poivre et une texture tannique. Les saveurs de levure lager viennent quilibrer le tout, dans un ensemble frais et exotique.', 'Lager\nSous une allure de blondinette,  se cache une bombe darmes mettant en vedette le th de Tawan et le poivre, une dlicate sensation de picotement poivre et une texture tannique. Les saveurs de levure lager viennent quilibrer le tout, dans un ensemble frais et exotique.', 1, '2023-11-07 10:11:46', '2023-11-07 10:11:46'),
(156, 275, 'Avec ses accents de malt caramel, cette brune costaude a de la finesse. Son nez de sucre dorge, ses notes de fruits schs et sa rondeur cralire combleront les dgustateurs.', 'Avec ses accents de malt caramel, cette brune costaude a de la finesse. Son nez de sucre dorge, ses notes de fruits schs et sa rondeur cralire combleront les dgustateurs.', 1, '2023-11-07 10:28:03', '2023-11-07 10:28:03'),
(157, 276, 'Quand Gros Mollet rencontre son chum Jack du Tennessee, tenez-vous bien! Vieillie en barriques de chne, notre brune dabbaye en ressort avec des armes de gousse de vanille, de noix de coco et de sucre drable.', 'Quand Gros Mollet rencontre son chum Jack du Tennessee, tenez-vous bien! Vieillie en barriques de chne, notre brune dabbaye en ressort avec des armes de gousse de vanille, de noix de coco et de sucre drable.', 1, '2023-11-07 10:29:17', '2023-11-07 10:29:17'),
(158, 277, 'Les notes de fruits rouges typiques des vins fortifis du Portugal se marient  merveille avec la prsence du caramel caractristique de votre Gros Mollet. Une anne en ft de porto a invite au voyage.', 'Les notes de fruits rouges typiques des vins fortifis du Portugal se marient  merveille avec la prsence du caramel caractristique de votre Gros Mollet. Une anne en ft de porto a invite au voyage.', 1, '2023-11-07 10:30:48', '2023-11-07 10:30:48'),
(159, 278, 'Lapparence est parfaite pour une lager traditionnelle non-filtre : blond soutenu, clart naturelle apprciable et dentelle de mousse blanche.  Les armes sont en harmonie, avec un houblon pic et rsineux suivi darmes fermentaires typiques des tempratures froides o travaillent les levures lager. En bouche, lquilibre entre la scheresse et le moelleux rend la prochaine gorge irrsistible. Larrire-got se dcline sur des notes herbaces.', 'Lapparence est parfaite pour une lager traditionnelle non-filtre : blond soutenu, clart naturelle apprciable et dentelle de mousse blanche.  Les armes sont en harmonie, avec un houblon pic et rsineux suivi darmes fermentaires typiques des tempratures froides o travaillent les levures lager. En bouche, lquilibre entre la scheresse et le moelleux rend la prochaine gorge irrsistible. Larrire-got se dcline sur des notes herbaces.', 1, '2023-11-07 10:32:08', '2023-11-07 10:32:08'),
(160, 279, 'Blonde belge de soif \n\nGnreusement houblonn  lAmarillo. Cette blonde  une finale sche et une pointe cralire qui la rend trs dsaltrante et appelle  la prochaine gorge.', 'Blonde belge de soif \n\nGnreusement houblonn  lAmarillo. Cette blonde  une finale sche et une pointe cralire qui la rend trs dsaltrante et appelle  la prochaine gorge.', 1, '2023-11-07 10:33:34', '2023-11-07 10:33:34'),
(161, 280, 'Surette  laronia 5,5%', 'Surette  laronia 5,5%', 1, '2023-11-07 10:34:47', '2023-11-07 10:34:47'),
(162, 281, 'Bire sure aux framboises\n\nEncore cette anne nous avons la chance de travailler avec des framboises locales (congeles videmment !) et vraiment les saveurs de nos  petites  framboises plus roses et plus surettes font merveille dans une des meilleurs bires de soleil de la microbrasserie du Lac ! Une couleur incroyable, un ptillement intense, une acidit modre et une forte dose de fruit compose ce joyau !', 'Bire sure aux framboises\n\nEncore cette anne nous avons la chance de travailler avec des framboises locales (congeles videmment !) et vraiment les saveurs de nos  petites  framboises plus roses et plus surettes font merveille dans une des meilleurs bires de soleil de la microbrasserie du Lac ! Une couleur incroyable, un ptillement intense, une acidit modre et une forte dose de fruit compose ce joyau !', 1, '2023-11-07 10:36:19', '2023-11-07 10:36:19'),
