(193, 312, 'Si cette bire porte le nom d\'un sous-marin allemand de la Seconde Guerre mondiale, c\'est dans le but de relater l\'histoire d\'un naufrage gaspsien. En effet, c\'est ce sous-marin qui  coul le HMCS Raccoon de la Marine royale canadienne dans le fleuve Saint-Laurent. Les deux navires sont  jamais lies dans l\'histoire, comme le sont la U-165 et la Raccoon : la premire est brasse  la suite de la seconde, de laquelle elle tire son sucre et ses gots pour en faire une version lgre, houblonne et pleine de saveur. Azote en bouteille, elle est trs lgre et prsente seulement 2,5% d\'alcool.', 'Si cette bire porte le nom d\'un sous-marin allemand de la Seconde Guerre mondiale, c\'est dans le but de relater l\'histoire d\'un naufrage gaspsien. En effet, c\'est ce sous-marin qui  coul le HMCS Raccoon de la Marine royale canadienne dans le fleuve Saint-Laurent. Les deux navires sont  jamais lies dans l\'histoire, comme le sont la U-165 et la Raccoon : la premire est brasse  la suite de la seconde, de laquelle elle tire son sucre et ses gots pour en faire une version lgre, houblonne et pleine de saveur. Azote en bouteille, elle est trs lgre et prsente seulement 2,5% d\'alcool.', 1, '2023-11-07 14:14:07', '2023-11-07 14:14:07'),
(194, 313, 'Affin plusieurs mois en barriques de Porto, il en rsulte un produit  la fois sec, fruit, acide et bois. Chaleureux, il tonne en bouche autant quil se laisse dguster. Cest un produit  la fois unique et dune belle complexit.', 'Affin plusieurs mois en barriques de Porto, il en rsulte un produit  la fois sec, fruit, acide et bois. Chaleureux, il tonne en bouche autant quil se laisse dguster. Cest un produit  la fois unique et dune belle complexit.', 1, '2023-11-07 14:15:28', '2023-11-07 14:15:28'),
