(196, 315, 'Amre et rafraichissante, La C.I.PA. est une bire o se marie amertume, souplesse et rondeur. Son bouquet citronn prsente des armes de fruit de la passion et de cerise de terre.', 'Amre et rafraichissante, La C.I.PA. est une bire o se marie amertume, souplesse et rondeur. Son bouquet citronn prsente des armes de fruit de la passion et de cerise de terre.', 1, '2023-11-07 14:57:06', '2023-11-07 14:57:06'),
(197, 316, 'Notre Stout  l\'avoine est rconfortante et crmeuse. Noir charbon, elle a en bouche un got de chocolat, de caf frachement moulu, de grains torrfis et de dattes. C\'est tout  fait possible que sa p\'tite mousse sucre te laisse une invitante moustache de crmage, un gros bonus dans notre livre  nous.', 'Notre Stout  l\'avoine est rconfortante et crmeuse. Noir charbon, elle a en bouche un got de chocolat, de caf frachement moulu, de grains torrfis et de dattes. C\'est tout  fait possible que sa p\'tite mousse sucre te laisse une invitante moustache de crmage, un gros bonus dans notre livre  nous.', 1, '2023-11-07 14:58:43', '2023-11-07 14:58:43'),
(198, 317, 'La Wayagamac est une bire de type Klsch caractrise par son houblonnage  cru. Rafraichissante, son bouquet prsente un doux mlange d\'armes de conifre, d\'abricot et de pamplemousse.', 'La Wayagamac est une bire de type Klsch caractrise par son houblonnage  cru. Rafraichissante, son bouquet prsente un doux mlange d\'armes de conifre, d\'abricot et de pamplemousse.', 1, '2023-11-07 14:59:38', '2023-11-07 14:59:38'),
(199, 318, 'c\'est une bire sure avec fraise et framboise locales', 'c\'est une bire sure avec fraise et framboise locales', 1, '2023-11-07 15:00:40', '2023-11-07 15:00:40'),
(200, 319, 'Miss Ghost n\'est plus...Ayant termin ses jours au Sanatorium de Lac-douard, elle hante dsormais partout au Qubec. Elle attire ses proies avec un parfum de lime, citron et coriandre. Par la suite, elle referme son pige avec une touche de poivre. Si vous la voyez, attention car elle va vous hanter pour le reste de votre vie et vous ne saurez vous en passer ! \"Mais qui \"G\"osera l\'approcher?\"', 'Miss Ghost n\'est plus...Ayant termin ses jours au Sanatorium de Lac-douard, elle hante dsormais partout au Qubec. Elle attire ses proies avec un parfum de lime, citron et coriandre. Par la suite, elle referme son pige avec une touche de poivre. Si vous la voyez, attention car elle va vous hanter pour le reste de votre vie et vous ne saurez vous en passer ! \"Mais qui \"G\"osera l\'approcher?\"', 1, '2023-11-07 15:01:30', '2023-11-07 15:01:30'),
(201, 320, 'L\'acidule Mme Rose a plus d\'un tour dans son sac ! Si vous croisez son chemin, attention  vos arrires ! Elle dgage un parfum fruit de shortcake qui saura vous envoter. En la ctoyant, vos papilles seront toujours stimules car elle matrise parfaitement le secret des petits fruits. Elle possde des potions ensorceles qui vous rendront dpendant de sa prsence. Mais qui risque rien, n\'a rien !', 'L\'acidule Mme Rose a plus d\'un tour dans son sac ! Si vous croisez son chemin, attention  vos arrires ! Elle dgage un parfum fruit de shortcake qui saura vous envoter. En la ctoyant, vos papilles seront toujours stimules car elle matrise parfaitement le secret des petits fruits. Elle possde des potions ensorceles qui vous rendront dpendant de sa prsence. Mais qui risque rien, n\'a rien !', 1, '2023-11-07 15:02:35', '2023-11-07 15:02:35'),
(202, 321, 'Dcouvrez l\'univers excentrique de Mr. Coffee! Dans une valle mystrieuse dont personne ne connat l\'emplacement, il ctoie des tres loufoques qui travaillent pour lui. De petites cratures intriguantes, au regard dor et  la personnalit dcafine, travaillent  la culture de plants uniques et majestueux qui arborent de surprennantes quantits de grains de caf, de noisettes et de cacao. Grce  sa clairvoyance et  son esprit sirupeux et envotant, ce lgendaire Mr. Coffee rgne incontestablement dans le march du grain de caf. Sa devise : \"Petit grain va loin!\"', 'Dcouvrez l\'univers excentrique de Mr. Coffee! Dans une valle mystrieuse dont personne ne connat l\'emplacement, il ctoie des tres loufoques qui travaillent pour lui. De petites cratures intriguantes, au regard dor et  la personnalit dcafine, travaillent  la culture de plants uniques et majestueux qui arborent de surprennantes quantits de grains de caf, de noisettes et de cacao. Grce  sa clairvoyance et  son esprit sirupeux et envotant, ce lgendaire Mr. Coffee rgne incontestablement dans le march du grain de caf. Sa devise : \"Petit grain va loin!\"', 1, '2023-11-07 15:03:31', '2023-11-07 15:03:31'),
