(283, 402, 'Profile:\n\nIndulge in the rich, velvety embrace of \"Cacao Oscuro Revelation,\" our signature Mexican Chocolate Stout that marries the robust character of traditional stout with the spicy warmth and sweetness of authentic Mexican chocolate. This opulent brew is an homage to the time-honored Mexican chocolate-making tradition, providing an adventurous exploration for the palate, steeped in cultural richness and culinary artistry.', 'Profile:\n\nIndulge in the rich, velvety embrace of \"Cacao Oscuro Revelation,\" our signature Mexican Chocolate Stout that marries the robust character of traditional stout with the spicy warmth and sweetness of authentic Mexican chocolate. This opulent brew is an homage to the time-honored Mexican chocolate-making tradition, providing an adventurous exploration for the palate, steeped in cultural richness and culinary artistry.\n\nAppearance:\n\nCacao Oscuro pours a deep, obsidian hue, as dark and enigmatic as a moonless night. A generous, creamy tan head crowns the brew, reminiscent of the frothy top of a freshly whipped hot chocolate, promising a luxurious experience.\n\nAroma:\n\nThe aroma is a symphony of contrast and harmony - dark roasted malts create an alluring foundation, exuding notes of espresso and dark chocolate, while the air is perfumed with the sweet, cinnamon-infused richness distinctive of Mexican chocolate. Subtle whispers of vanilla and almond offer a hint of sweetness, and a faint, spicy chili presence tickles the nose, adding an invigorating twist to the bouquet.\n\nTaste:\n\nOn the first sip, your taste buds are greeted by the bittersweet character of dark cocoa, robust and full-bodied, characteristic of the stout\'s backbone. This richness is swiftly complemented by the unique profile of Mexican chocolate - the sweetness of cinnamon and sugar, the creamy nuances of vanilla, and the nutty undertones of almond. As the flavor profile deepens, the playful heat of chili peppers emerges, offering a gentle warmth that does not overpower but rather balances the chocolate\'s sweetness. The sip culminates in a melody of these flavors, lingering on the palate and inviting another taste.\n\nMouthfeel:\n\nDespite its bold flavor profile, Cacao Oscuro maintains a silky, almost velvety mouthfeel. The moderate carbonation ensures a smooth ride for all the intricate flavors at play, while the subtle heat from the chili peppers provides a pleasant warmth, stimulating the senses and complementing the beer\'s full body.\n\nOverall Experience:\n\nCacao Oscuro Revelation is not just a beer; it\'s a journey through the rich tapestry of Mexican culinary art, transformed into a liquid delicacy. It\'s an ideal companion for the stout aficionado looking to venture into new territories, or the adventurous drinker seeking a brew that tells a story. Perfect to be savored solo, it also pairs splendidly with rich desserts or hearty, spicy meals. Each sip is a celebration of culture, tradition, and the unending quest for flavors that excite and inspire. Salud!', 1, '2023-11-09 19:27:20', '2023-11-09 19:27:20'),
(284, 403, ' Abbey Ale 6.5%\n\nProfile:\n\nEmbark on a divine journey with \"Monastic Harmony,\" our distinguished Abbey Ale, crafted with reverence to ancient brewing traditions. At 6.5%, this medium-bodied elixir balances spiritual contemplation with joyous liberation, offering a transcendent experience wrapped in the cloak of a monk\'s dedication.', 'Appearance:\n\nThis hallowed brew presents itself in a radiant amber-brown robe, adorned with a persistent off-white head that speaks to the fervent prayers of carbonation beneath.\n\nAroma:\n\nGraceful aromas of ripe fruit meet the nostrils, with hints of banana, clove, and a whisper of caramel sweetness, akin to the scent of a secluded abbey orchard in full bloom.\n\nTaste:\n\nMonastic Harmony\'s flavor is a testament to its name, with the gentle sweetness of malted barley in perfect concert with fruity esters and a hint of spice. The 6.5% alcohol content is artfully masked beneath the ale\'s celestial profile, providing warmth without an overt boozy distraction.\n\nMouthfeel:\n\nSilken yet effervescent, this Abbey Ale offers a medium body and lively carbonation, making each sip a revitalizing mantra of flavor and tradition.\n\nOverall Experience:\n\n\"Monastic Harmony\" is more than a beer; it\'s the liquid hymn of centuries-old brewing devotion. Ideal for quiet reflection or spirited conversation, it pairs beautifully with soft cheeses, hearty stews, or a tranquil moment alone. Let this Abbey Ale elevate your spirit with each harmonious sip. Cheers!', 1, '2023-11-09 19:38:36', '2023-11-09 19:38:36'),
(285, 404, 'Cette blanche complte le trio de notre Srie Classique St-Mathieu. Brasse avec une levure belge et un soupon dorange, notre Witbier libre un agrable parfum dagrumes. En bouche, on dcouvre un got frais et des saveurs dlicates dorange et de muscade. Cette bire de bl plaira assurment aux amateurs de blanches de type belge.', 'Cette blanche complte le trio de notre Srie Classique St-Mathieu. Brasse avec une levure belge et un soupon dorange, notre Witbier libre un agrable parfum dagrumes. En bouche, on dcouvre un got frais et des saveurs dlicates dorange et de muscade. Cette bire de bl plaira assurment aux amateurs de blanches de type belge.', 1, '2023-11-14 10:31:31', '2023-11-14 10:31:31'),
(286, 405, 'Cette bire blonde se veut lgre et dsaltrante. Bien balance, avec de dlicates notes cralires et des houblons discrets, cest une bire qui se boit aisment.', 'Cette bire blonde se veut lgre et dsaltrante. Bien balance, avec de dlicates notes cralires et des houblons discrets, cest une bire qui se boit aisment.', 1, '2023-11-14 10:34:42', '2023-11-14 10:34:42'),
(287, 406, 'Pour ce projet, Birerie Shelton sest associe au micro-torrfacteur montralais Saint-Henri. Nous avons soigneusement slectionn le caf idal pour cette bire: le Godshot. Ce caf, lgrement torrfi, offre des notes de zeste d\'orange et de sucre brun.  la suite de la fermentation, nous avons infus  froid les grains de caf et galement ajout une petite touche de vanille et du lactose. Il en rsulte une bire blonde vivifiante et exotique, aux armes enivrants.', 'Pour ce projet, Birerie Shelton sest associe au micro-torrfacteur montralais Saint-Henri. Nous avons soigneusement slectionn le caf idal pour cette bire: le Godshot. Ce caf, lgrement torrfi, offre des notes de zeste d\'orange et de sucre brun.  la suite de la fermentation, nous avons infus  froid les grains de caf et galement ajout une petite touche de vanille et du lactose. Il en rsulte une bire blonde vivifiante et exotique, aux armes enivrants.', 1, '2023-11-14 10:35:46', '2023-11-14 10:35:46'),
(288, 407, 'Originaire dAllemagne, la Gose se caractrise par sa fermentation lactique et lajout de sel de mer. Ce dernier donne de la rondeur  la bire, tel un soupon de sel qui rehausse un bon mets. Au lieu de brasser notre Gose avec de la coriandre, comme dans la version classique, nous avons choisi dy ajouter de lorange sanguine et du citron Meyer. Ces agrumes lui donnent un got  la fois acidul et fruit, en plus dune jolie teinte rouge-orang. Les notes cralires en finale nous rappellent quil sagit dune bire de bl. Ose la Gose!', 'Originaire dAllemagne, la Gose se caractrise par sa fermentation lactique et lajout de sel de mer. Ce dernier donne de la rondeur  la bire, tel un soupon de sel qui rehausse un bon mets. Au lieu de brasser notre Gose avec de la coriandre, comme dans la version classique, nous avons choisi dy ajouter de lorange sanguine et du citron Meyer. Ces agrumes lui donnent un got  la fois acidul et fruit, en plus dune jolie teinte rouge-orang. Les notes cralires en finale nous rappellent quil sagit dune bire de bl. Ose la Gose!', 1, '2023-11-14 10:44:35', '2023-11-14 10:44:35'),
(289, 408, 'Cette bire blonde dorigine polonaise est brasse avec du bl fum au bois de chne. Dsaltrante, lgrement amre et fume, cest une bire parfaite pour les chaudes journes dt.', 'Cette bire blonde dorigine polonaise est brasse avec du bl fum au bois de chne. Dsaltrante, lgrement amre et fume, cest une bire parfaite pour les chaudes journes dt.', 1, '2023-11-14 10:45:51', '2023-11-14 10:45:51'),
(290, 409, 'La Klsch est une bire allemande provenant de la ville de Cologne. Elle est conditionne  froid comme les lagers. Le rsultat est une bire blonde toute en subtilits. On y retrouve des saveurs lgrement maltes, herbaces et fruites. Une douce amertume simmisce en finale.', 'La Klsch est une bire allemande provenant de la ville de Cologne. Elle est conditionne  froid comme les lagers. Le rsultat est une bire blonde toute en subtilits. On y retrouve des saveurs lgrement maltes, herbaces et fruites. Une douce amertume simmisce en finale.', 1, '2023-11-14 10:47:14', '2023-11-14 10:47:14'),
(291, 410, 'La Mild est une bire brune dorigine anglaise aux accents de malt et de noisettes. Comme ce style historique, notre Mild est  la fois savoureuse et facile  boire. Cette bire accompagnera parfaitement vos soires conviviales entre amis!', 'La Mild est une bire brune dorigine anglaise aux accents de malt et de noisettes. Comme ce style historique, notre Mild est  la fois savoureuse et facile  boire. Cette bire accompagnera parfaitement vos soires conviviales entre amis!', 1, '2023-11-14 10:51:44', '2023-11-14 10:51:44'),
(292, 411, 'Cette bire s\'inscrit dans le courant des milkshake IPA. Pour ajouter au plaisir, nous avons opt pour une version sure. Notre Milkshake IPA sure aux abricots a t brasse avec le trs fruit houblon Citra en dry hop. Elle contient aussi une grande quantit d\'abricots, du lactose et un peu de vanille. Au nez, c\'est fruit et vanill. En bouche, on a le mordant d\'une bire sure qui fait ensuite place  la douceur des abricots et de la vanille. Lquilibre est prserv entre les aspects surs et sucrs, afin doffrir une bire pleine de contrastes et de saveurs!', 'Cette bire s\'inscrit dans le courant des milkshake IPA. Pour ajouter au plaisir, nous avons opt pour une version sure. Notre Milkshake IPA sure aux abricots a t brasse avec le trs fruit houblon Citra en dry hop. Elle contient aussi une grande quantit d\'abricots, du lactose et un peu de vanille. Au nez, c\'est fruit et vanill. En bouche, on a le mordant d\'une bire sure qui fait ensuite place  la douceur des abricots et de la vanille. Lquilibre est prserv entre les aspects surs et sucrs, afin doffrir une bire pleine de contrastes et de saveurs!', 1, '2023-11-14 10:53:05', '2023-11-14 10:53:05'),
(293, 412, 'Amateurs de Pils, voici la version Shelton de la clbre Pilsner tchque Svtl Lek ! Cette bire blonde au got frais et malt possde un ct herbac qui provient du houblon Saaz, ainsi quune certaine amertume caractristique du style. Notre Svtl Lek a t brasse avec une levure typique provenant de Tchquie. Gazifie naturellement, la bire a une belle mousse dense et des bulles dlicates. Pour une exprience totale, gotez-y dans notre salon de dgustation servie au robinet tchque (lukr), ce qui lui confre une mousse aussi sublime que spectaculaire!', 'Amateurs de Pils, voici la version Shelton de la clbre Pilsner tchque Svtl Lek ! Cette bire blonde au got frais et malt possde un ct herbac qui provient du houblon Saaz, ainsi quune certaine amertume caractristique du style. Notre Svtl Lek a t brasse avec une levure typique provenant de Tchquie. Gazifie naturellement, la bire a une belle mousse dense et des bulles dlicates. Pour une exprience totale, gotez-y dans notre salon de dgustation servie au robinet tchque (lukr), ce qui lui confre une mousse aussi sublime que spectaculaire!', 1, '2023-11-14 10:54:54', '2023-11-14 10:54:54'),
(294, 413, 'Avec sa belle teinte rougetre et ses douces notes de malt et de caramel, notre Rousse porte bien son nom. Facile  boire, avec une amertume faible et un taux dalcool de 4,5%, cette bire ambre a tout ce quil faut pour devenir ta rousse prfre!', 'Avec sa belle teinte rougetre et ses douces notes de malt et de caramel, notre Rousse porte bien son nom. Facile  boire, avec une amertume faible et un taux dalcool de 4,5%, cette bire ambre a tout ce quil faut pour devenir ta rousse prfre!', 1, '2023-11-14 11:11:52', '2023-11-14 11:11:52'),
