(313, 432, 'La Bire : La Mujo clbre le caractre phmre de la beaut et le sentiment de douce nostalgie den tre tmoin.   La Mujo (impermanence) est un hybride entre un sak et une saison fermire houblonne. Bire rafrachissante et sche, elle prsente des notes fruites, florales et phnoles subtiles. Le cidre : Cidre de fermentation spontane de pommettes Dolgo aux tannins fermes et explosifs, franche acidit et au caractre sauvage. Sa teinte  peine ros et ses armes de pommes acidul, rhubarbe et agrumes sont des attributs dans cette assemblage original. 55% Mujo 45% cidre de Dolgo Carbonate (2.3)', 'La Bire : La Mujo clbre le caractre phmre de la beaut et le sentiment de douce nostalgie den tre tmoin.   La Mujo (impermanence) est un hybride entre un sak et une saison fermire houblonne. Bire rafrachissante et sche, elle prsente des notes fruites, florales et phnoles subtiles. Le cidre : Cidre de fermentation spontane de pommettes Dolgo aux tannins fermes et explosifs, franche acidit et au caractre sauvage. Sa teinte  peine ros et ses armes de pommes acidul, rhubarbe et agrumes sont des attributs dans cette assemblage original. 55% Mujo 45% cidre de Dolgo Carbonate (2.3)', 1, '2023-11-18 11:01:35', '2023-11-18 11:01:35'),
(314, 433, 'Cidre brut vinifi avec des pommes biologiques, macration de marcs de pommes.', 'Cidre brut vinifi avec des pommes biologiques, macration de marcs de pommes.', 1, '2023-11-18 11:02:54', '2023-11-18 11:02:54'),
(315, 434, 'Cidre brut vinifi avec des pommes biologiques. Ajout de levures brettanomyces claussenii. Prise de mousse en canette.', 'Cidre brut vinifi avec des pommes biologiques. Ajout de levures brettanomyces claussenii. Prise de mousse en canette.', 1, '2023-11-18 11:04:10', '2023-11-18 11:04:10'),
(316, 435, 'Loup Garou\nAAAAHHHHOUUUUU! \n\nCette cuve est pour nous un hybride entre nos cuves de fruits, donc\navec addition de fruits autre que la pomme et nos cuves vins que nous faisons\navec des raisins de cuve des copains dici et de plus loin. \n\nLes marcs Riesling (50% du poids du mot de pommes) ont macr 3\nsemaines dans un mot de McIntosh en bullition afin dextraire laromatique\nexotique et surtout les tannins fins, mais robuste de ce cpage aux accents\nfrais et nordique. En cours de fermentation nous avons ajout des glantiers\nsauvages qui ont parfum encore notre cidre. Cest bien tannique! Par contre,\nlheureux assemblage donne du caractre et une bonne dose de funk en bouche\navec un nez envoutant de fruits gourmands.  \n\n90% pommes du verger\nqubcois sur marcs de Riesling et glantiers sauvages \n10% Pommettes Dolgo\n(secteur cantons de lest) \n\nPtillant Naturel  \nSans sucre rsiduel  \nSans sulfites ajouts \nSans filtration \nFermentation spontane', 'Loup Garou\nAAAAHHHHOUUUUU! \n\nCette cuve est pour nous un hybride entre nos cuves de fruits, donc\navec addition de fruits autre que la pomme et nos cuves vins que nous faisons\navec des raisins de cuve des copains dici et de plus loin. \n\nLes marcs Riesling (50% du poids du mot de pommes) ont macr 3\nsemaines dans un mot de McIntosh en bullition afin dextraire laromatique\nexotique et surtout les tannins fins, mais robuste de ce cpage aux accents\nfrais et nordique. En cours de fermentation nous avons ajout des glantiers\nsauvages qui ont parfum encore notre cidre. Cest bien tannique! Par contre,\nlheureux assemblage donne du caractre et une bonne dose de funk en bouche\navec un nez envoutant de fruits gourmands.  \n\n90% pommes du verger\nqubcois sur marcs de Riesling et glantiers sauvages \n10% Pommettes Dolgo\n(secteur cantons de lest) \n\nPtillant Naturel  \nSans sucre rsiduel  \nSans sulfites ajouts \nSans filtration \nFermentation spontane', 1, '2023-11-18 11:05:22', '2023-11-18 11:05:22'),
(317, 436, ' Nous sommes alls chercher  Niagara 1 tonne de Cabernet Sauvignon et Cabernet Franc frachement dcuve suite  une macration de raisins grapps de plusieurs semaines.   Les raisins avaient beaucoup donn, mais leur qualit (a vient dun des meilleurs domaines canadiens), les parfums de ronce, de rose et le muscle taient toujours bien prsents. Une infusion de 3 semaines sur les jus de McIntosh biologiques en fermentation a extrait le fun de ce terroir viticole voisin. a donne une cuve accessible qui rallie pomme et raisin dans une offrande saline, frache et rose  souhait.    100% de McIntosh biologiques sur marcs de Cabernet Franc et Sauvignon (McIntosh : secteur Saint-Joseph du Lac, Cabernets : Niagara)', ' Nous sommes alls chercher  Niagara 1 tonne de Cabernet Sauvignon et Cabernet Franc frachement dcuve suite  une macration de raisins grapps de plusieurs semaines.   Les raisins avaient beaucoup donn, mais leur qualit (a vient dun des meilleurs domaines canadiens), les parfums de ronce, de rose et le muscle taient toujours bien prsents. Une infusion de 3 semaines sur les jus de McIntosh biologiques en fermentation a extrait le fun de ce terroir viticole voisin. a donne une cuve accessible qui rallie pomme et raisin dans une offrande saline, frache et rose  souhait.    100% de McIntosh biologiques sur marcs de Cabernet Franc et Sauvignon (McIntosh : secteur Saint-Joseph du Lac, Cabernets : Niagara)', 1, '2023-11-18 11:07:05', '2023-11-18 11:07:05'),
(318, 437, 'Cidre brut vinifi avec des pommes biologiques, macration de framboises.', 'Cidre brut vinifi avec des pommes biologiques, macration de framboises.', 1, '2023-11-18 11:08:12', '2023-11-18 11:08:12');
