(319, 438, 'Sanlucar est un village dAndalousie berc par les embruns marins o lon fait la Manzanilla, un Xres fresh et salin. Nous nous sommes inspirs de ce vin pour labor cette cuve unique.\n\nCe cidre est compos de fermentations spontanes de pommes liberty biologiques 2021 et de chardonnay 2017 de Niagara. Le cidre ft lev un an et le chardonnay 5 ans en cuve. Lassemblage a t fait en automne 2022 avec un brin de pommettes dolgo pour une touche damertume. Llevage jour un rle dterminant dans cette cuve et donne beaucoup de caractre  cet hybride non conventionnel. Lge et llevage joue du coude avec une bulle riche et onctueuse. Cest un cidre daventurier, damoureux du vin jaune et du Xrs et des pices douces comme le curry et safran. ', 'Sanlucar est un village dAndalousie berc par les embruns marins o lon fait la Manzanilla, un Xres fresh et salin. Nous nous sommes inspirs de ce vin pour labor cette cuve unique.\n\nCe cidre est compos de fermentations spontanes de pommes liberty biologiques 2021 et de chardonnay 2017 de Niagara. Le cidre ft lev un an et le chardonnay 5 ans en cuve. Lassemblage a t fait en automne 2022 avec un brin de pommettes dolgo pour une touche damertume. Llevage jour un rle dterminant dans cette cuve et donne beaucoup de caractre  cet hybride non conventionnel. Lge et llevage joue du coude avec une bulle riche et onctueuse. Cest un cidre daventurier, damoureux du vin jaune et du Xrs et des pices douces comme le curry et safran. ', 1, '2023-11-18 11:09:41', '2023-11-18 11:09:41'),
(320, 439, 'Cidre brut de macration pelliculaire ptillant.', 'Cidre brut de macration pelliculaire ptillant.', 1, '2023-11-18 11:10:45', '2023-11-18 11:10:45'),
(321, 440, 'Villefranche\nGamay, Gamay, Gamay! Vive Villefranche! \n\nVillefranche cest la\ncapitale du Beaujolais et de son cpage emblmatique le Gamay. On a voulu\nrendre hommage  ces vins que nous aimons tant pour leur gourmandise et leur\ncaractre festif. \n\nLes marcs de Gamay de\npressurage direct (grappes entires) de chez Maison Agricole Joy Hill furent\ninfuss dans du jus de Mcintosch pendant 3 semaines avec des pigeages manuels\net journaliers. On a extrait tout ce que lon pouvait! Ensuite, nous avons lev\nnotre prcieux cidre au Gamay dans des fts de chne franais de plusieurs\npassages en prenant bien soin de faire nos ouillages avec du vin de Gamay\nprovenant des fins de mise en bouteille du mme dlicieux Gamay. On a par le\nfait mme augmenter naturellement le taux dalcool et ajouter du corps et du\npoids. La prise de mousse est faite avec des jus frais et dsire relativement\nbasse pour laisser toute la place  ce cpage roi des ftes arroses! \n\n-95% Mcintosh sur marc de\nGamay (secteur Saint-Joseph) 2022  \n-5% pommettes Dolgo\n(secteur cantons de lest) 2022 \n\nPtillant Naturel    \nSans sulfites ajouts \nSans filtration \nFermentation spontane', 'Villefranche\nGamay, Gamay, Gamay! Vive Villefranche! \n\nVillefranche cest la\ncapitale du Beaujolais et de son cpage emblmatique le Gamay. On a voulu\nrendre hommage  ces vins que nous aimons tant pour leur gourmandise et leur\ncaractre festif. \n\nLes marcs de Gamay de\npressurage direct (grappes entires) de chez Maison Agricole Joy Hill furent\ninfuss dans du jus de Mcintosch pendant 3 semaines avec des pigeages manuels\net journaliers. On a extrait tout ce que lon pouvait! Ensuite, nous avons lev\nnotre prcieux cidre au Gamay dans des fts de chne franais de plusieurs\npassages en prenant bien soin de faire nos ouillages avec du vin de Gamay\nprovenant des fins de mise en bouteille du mme dlicieux Gamay. On a par le\nfait mme augmenter naturellement le taux dalcool et ajouter du corps et du\npoids. La prise de mousse est faite avec des jus frais et dsire relativement\nbasse pour laisser toute la place  ce cpage roi des ftes arroses! \n\n-95% Mcintosh sur marc de\nGamay (secteur Saint-Joseph) 2022  \n-5% pommettes Dolgo\n(secteur cantons de lest) 2022 \n\nPtillant Naturel    \nSans sulfites ajouts \nSans filtration \nFermentation spontane', 1, '2023-11-18 11:11:57', '2023-11-18 11:11:57'),
