(436, 555, 'Bire blanche  la camomille. Il s\'agit d\'une bire blanche classique, dans laquelle on ninfuse une grande quantit de fleurs de camomille, comme un grosse tisane. Son nom provient des caractristiques relaxantes de la camomille, mais aussi du plaisir qui dcoule de prendre une bonne bire sur une terrasse en bonne compagnie.', 'Bire blanche  la camomille. Il s\'agit d\'une bire blanche classique, dans laquelle on ninfuse une grande quantit de fleurs de camomille, comme un grosse tisane. Son nom provient des caractristiques relaxantes de la camomille, mais aussi du plaisir qui dcoule de prendre une bonne bire sur une terrasse en bonne compagnie.', 1, '2023-12-01 11:03:39', '2023-12-01 11:03:39'),
(437, 556, 'Chez Lagabire, nous sommes fiers de pouvoir compter sur plusieurs vtrans des Forces Armes Canadiennes, qui contribuent au succs de lentreprise.\n\n\n\n\nQuoi de mieux, qu\'une bonne Lager dsaltrante, idale pour boire entre camarades, tant au mess qu la maison!\n\n\n\n\nPour chaque canette de La Bravoure vendue, 1$ sera vers  la Fondation Qubcoise des Vtrans qui simplique  de multiples niveaux pour aider au bien tre de ceux et celles qui ont servis', 'Chez Lagabire, nous sommes fiers de pouvoir compter sur plusieurs vtrans des Forces Armes Canadiennes, qui contribuent au succs de lentreprise.\n\n\n\n\nQuoi de mieux, qu\'une bonne Lager dsaltrante, idale pour boire entre camarades, tant au mess qu la maison!\n\n\n\n\nPour chaque canette de La Bravoure vendue, 1$ sera vers  la Fondation Qubcoise des Vtrans qui simplique  de multiples niveaux pour aider au bien tre de ceux et celles qui ont servis', 1, '2023-12-01 11:09:22', '2023-12-01 11:09:22'),
