(451, 570, 'Dcouvrez toutes les facettes complexes, fruites et florales du houblon Mosaic, dans cette Pale Ale Amricaine 100% Mosaic ! Notre version de ce classique possde un intense voile, typique des bires de la Nouvelle-Angleterre, mais offre un corps sec et rafraichissant, ainsi quune lgre amertume tranchante, ce qui en fait une bire de soif houblonne de prdilection.', 'Dcouvrez toutes les facettes complexes, fruites et florales du houblon Mosaic, dans cette Pale Ale Amricaine 100% Mosaic ! Notre version de ce classique possde un intense voile, typique des bires de la Nouvelle-Angleterre, mais offre un corps sec et rafraichissant, ainsi quune lgre amertume tranchante, ce qui en fait une bire de soif houblonne de prdilection.', 1, '2023-12-01 11:30:11', '2023-12-01 11:30:11'),
(452, 571, 'Edition spciale de la Lagablonde pour la pizzria Phil & Fred de St-Jean', 'Edition spciale de la Lagablonde pour la pizzria Phil & Fred de St-Jean', 1, '2023-12-01 11:31:19', '2023-12-01 11:31:19'),
