(454, 573, 'Ta Blonde Sans Alcool\n', 'Ta Blonde Sans Alcool\n', 1, '2023-12-01 11:33:53', '2023-12-01 11:33:53'),
(455, 574, 'Produit phare de Lagabire, cette dlicieuse India Pale Ale de type  Nouvelle-Angleterre  ou  Nord-Est  prsente une robe voile typique du style. Au nez, un bouquet explosif dhoublon rappelant les agrumes et les fruits tropicaux donne limpression dun jus de fruit, alors quen bouche une faible amertume ainsi que dintenses saveurs dhoublons fruites camouflent son taux dalcool relativement lev. Ta Meilleure est\ndevenu la rfrence en bire de type NEIPA au Qubec. Il sagit de notre meilleur vendeur ace jour et elle continue de battre des records de popularite!', 'Produit phare de Lagabire, cette dlicieuse India Pale Ale de type  Nouvelle-Angleterre  ou  Nord-Est  prsente une robe voile typique du style. Au nez, un bouquet explosif dhoublon rappelant les agrumes et les fruits tropicaux donne limpression dun jus de fruit, alors quen bouche une faible amertume ainsi que dintenses saveurs dhoublons fruites camouflent son taux dalcool relativement lev. Ta Meilleure est\ndevenu la rfrence en bire de type NEIPA au Qubec. Il sagit de notre meilleur vendeur ace jour et elle continue de battre des records de popularite!', 1, '2023-12-01 12:01:14', '2023-12-01 12:01:14'),
(456, 575, 'Sans alcool', 'Sans alcool', 1, '2023-12-01 12:02:24', '2023-12-01 12:02:24'),
(457, 576, 'Petite soeur de la Ta Meilleure, la Ta Moins Forte, de style  Session NEIPA , offre toutes les qualits aromatique, visuelle et gustative dune IPA du Nord-Est, avec un taux dalcool permettant den apprcier plus dune ! Au nez, lagrume et les fruits tropicaux des houblons sont trs prsents, de mme quen bouche. Dbordante de saveurs malgr son faible taux dalcool, la Ta Moins Forte est la bire de soif par excellence des amateurs de houblon !', 'Petite soeur de la Ta Meilleure, la Ta Moins Forte, de style  Session NEIPA , offre toutes les qualits aromatique, visuelle et gustative dune IPA du Nord-Est, avec un taux dalcool permettant den apprcier plus dune ! Au nez, lagrume et les fruits tropicaux des houblons sont trs prsents, de mme quen bouche. Dbordante de saveurs malgr son faible taux dalcool, la Ta Moins Forte est la bire de soif par excellence des amateurs de houblon !', 1, '2023-12-01 12:03:23', '2023-12-01 12:03:23'),
(458, 577, 'Voici notre interprtation du style ayant sans doute le plus marqu l\'histoire du brassage. Laissez-vous dsaltrer par cette bire  l\'quilibre parfait,  l\'effervescence mordante dans lequel les houblons nobles laissent une douce amertume et de dlicieuses notes herbaces, contenues par un collet tenace et gnreux. Parce que mme le plus grand amateur de houblon a besoin d\'un retour aux sources de temps  autre, voici le yin de notre yang !', 'Voici notre interprtation du style ayant sans doute le plus marqu l\'histoire du brassage. Laissez-vous dsaltrer par cette bire  l\'quilibre parfait,  l\'effervescence mordante dans lequel les houblons nobles laissent une douce amertume et de dlicieuses notes herbaces, contenues par un collet tenace et gnreux. Parce que mme le plus grand amateur de houblon a besoin d\'un retour aux sources de temps  autre, voici le yin de notre yang !', 1, '2023-12-01 12:05:48', '2023-12-01 12:05:48'),
(459, 578, 'Ta Plus Meilleure (double NEIPA) est une version enjolive de la Ta Meilleure, brasse sur la mme base, avec les mmes houblons,  laquelle on ajoute de la pure de pche et de fruit de la passion. En plus daugmenter le taux dalcool, les fruits apportent  la bire une texture plus onctueuse et un ctefruitesans prcdant autant a laromatique quau got. Lacidit naturelle du fruit de la passion ajoute une autre dimension  la bire, camouflant totalement son haut taux dalcool et rendant lexperience de degustation unique.', 'Ta Plus Meilleure (double NEIPA) est une version enjolive de la Ta Meilleure, brasse sur la mme base, avec les mmes houblons,  laquelle on ajoute de la pure de pche et de fruit de la passion. En plus daugmenter le taux dalcool, les fruits apportent  la bire une texture plus onctueuse et un ctefruitesans prcdant autant a laromatique quau got. Lacidit naturelle du fruit de la passion ajoute une autre dimension  la bire, camouflant totalement son haut taux dalcool et rendant lexperience de degustation unique.', 1, '2023-12-01 12:15:23', '2023-12-01 12:15:23'),
(460, 579, 'Une rousse qui ne souffre pas d\'tre sans alcool! A essayer absolument si vous tes un amateur.', 'Une rousse qui ne souffre pas d\'tre sans alcool! A essayer absolument si vous tes un amateur.', 1, '2023-12-01 12:17:12', '2023-12-01 12:17:12');
