(469, 588, 'Son nom veut littralement dire, Bire Noire.\nNoire comme la robe de cette Stout Impriale.\nNoire comme l\'intrieur du ft de Bourbon dans lequel elle a t vieillie et affine.', 'Son nom veut littralement dire, Bire Noire.\nNoire comme la robe de cette Stout Impriale.\nNoire comme l\'intrieur du ft de Bourbon dans lequel elle a t vieillie et affine.', 1, '2023-12-01 12:42:10', '2023-12-01 12:42:10'),
(470, 589, 'Cette bire rousse fonce est brasse selon les mthodes anglaises. Elle possde un riche arme de caramel qui se poursuit par des subtils gouts de noisettes. La finale est enrobe de houblons anglais au gout terreux qui viennent ajouter une touche bien dose damertume. IBU : 33 Houblons : fuggle, golding', 'Cette bire rousse fonce est brasse selon les mthodes anglaises. Elle possde un riche arme de caramel qui se poursuit par des subtils gouts de noisettes. La finale est enrobe de houblons anglais au gout terreux qui viennent ajouter une touche bien dose damertume. IBU : 33 Houblons : fuggle, golding', 1, '2023-12-01 12:42:59', '2023-12-01 12:42:59'),
(471, 590, 'Pale ale domine par de sublimes armes de fruits tropicaux et d\'un soupon d\'amertume. Le mlange des quatre houblons qui l\'habitent lui apporte tout son corps et une finale tout en douceur enrobe d\'une lgre crale croquante et seche.', 'Pale ale domine par de sublimes armes de fruits tropicaux et d\'un soupon d\'amertume. Le mlange des quatre houblons qui l\'habitent lui apporte tout son corps et une finale tout en douceur enrobe d\'une lgre crale croquante et seche.', 1, '2023-12-01 12:44:03', '2023-12-01 12:44:03'),
(472, 591, 'La Foublonne est une bire dinspiration amricaine aux reflets orangs quasi rougeoyants. Bien houblonne, elle nous dvoile de riches armes floraux et malts, suivis dune finale trs poignante dagrumes. Les amateurs de bires houblonnes seront combls. IBU : 65 Houblons : Warrior, Cascade, Centennial, Chinook', 'La Foublonne est une bire dinspiration amricaine aux reflets orangs quasi rougeoyants. Bien houblonne, elle nous dvoile de riches armes floraux et malts, suivis dune finale trs poignante dagrumes. Les amateurs de bires houblonnes seront combls. IBU : 65 Houblons : Warrior, Cascade, Centennial, Chinook', 1, '2023-12-01 12:44:54', '2023-12-01 12:44:54'),
(473, 592, 'La Gosebuster est une bire dun style bien particulier. Venant de la tradition allemande des goses, cette bire est brasse avec du sel marin et des feuilles de Kaffir lui confrant un gout de lime et de sel. Son cot imprial vient du fait que nous avons doubl la teneur en alcool des goses traditionnelles. IBU : 14 Houblons : Sorachi Ace, Equinox,', 'La Gosebuster est une bire dun style bien particulier. Venant de la tradition allemande des goses, cette bire est brasse avec du sel marin et des feuilles de Kaffir lui confrant un gout de lime et de sel. Son cot imprial vient du fait que nous avons doubl la teneur en alcool des goses traditionnelles. IBU : 14 Houblons : Sorachi Ace, Equinox,', 1, '2023-12-01 12:45:40', '2023-12-01 12:45:40'),
(474, 593, 'Version sans alcool de notre trs populaire Gosebuster. Produit sure et sal, cette bire aromatise avec de la feuille de lime et des la lime entire est trs diffrente des produits normalement offert sur le march des bires sans alcool. Rafrachissante et trs goteuse, cette bire se rapproche beaucoup dun margarita sans alcool. IBU : 8 Houblons : Citra', 'Version sans alcool de notre trs populaire Gosebuster. Produit sure et sal, cette bire aromatise avec de la feuille de lime et des la lime entire est trs diffrente des produits normalement offert sur le march des bires sans alcool. Rafrachissante et trs goteuse, cette bire se rapproche beaucoup dun margarita sans alcool. IBU : 8 Houblons : Citra', 1, '2023-12-01 12:46:31', '2023-12-01 12:46:31'),
(475, 594, 'La OBorn Evil est une bire de type Scotch Ale dun brun obscur aux reflets rougeoyants. Inspire des bires fortes issues de lcosse, elle a ltoffe dune bire dhiver o il est bon de se rfugier pour y trouver un chaleureux got de malt et de caramel. Lalcool y est bien prsent et se mari  merveille avec des notes de prune et de fruits confits.', 'La OBorn Evil est une bire de type Scotch Ale dun brun obscur aux reflets rougeoyants. Inspire des bires fortes issues de lcosse, elle a ltoffe dune bire dhiver o il est bon de se rfugier pour y trouver un chaleureux got de malt et de caramel. Lalcool y est bien prsent et se mari  merveille avec des notes de prune et de fruits confits.', 1, '2023-12-01 12:47:53', '2023-12-01 12:47:53'),
(476, 595, 'Version nano de la Sagesse sans alcool. Bire extra lgre', 'Version nano de la Sagesse sans alcool. Bire extra lgre', 1, '2023-12-01 12:48:56', '2023-12-01 12:48:56'),
(477, 596, 'Premire cration sans alcool pour la brasserie, une bire floral et lgrement amre qui nous transporte facilement vers le monde complexe des bires artisanale sans toutefois avoir lalcool typiquement associ au produit. IBU : 25 Houblons : Falconers Flight', 'Premire cration sans alcool pour la brasserie, une bire floral et lgrement amre qui nous transporte facilement vers le monde complexe des bires artisanale sans toutefois avoir lalcool typiquement associ au produit. IBU : 25 Houblons : Falconers Flight', 1, '2023-12-01 12:49:44', '2023-12-01 12:49:44'),
(478, 597, 'La Victor Sabro est une bire de type New England IPA. Cela lui confre une robe orange qui est trouble et plutt opaque. Gnreusement houblonne, des armes rappelant le got des fruits tropicaux et la noix de coco peuvent tre relevs.', 'La Victor Sabro est une bire de type New England IPA. Cela lui confre une robe orange qui est trouble et plutt opaque. Gnreusement houblonne, des armes rappelant le got des fruits tropicaux et la noix de coco peuvent tre relevs.', 1, '2023-12-01 12:52:48', '2023-12-01 12:52:48'),
(479, 598, 'Notre produit vedette: une IPA du Nord-Est pour avoir l\'impression d\'tre dans les tropiques. Des tonnes de houblons ont t rpartis dans deux houblonnages  cru ce qui confre le nez de fruits tropicaux caractristique  la Hazy. Au moment de verser cette IPA du Nord-Est, on remarque tout de suite la couleur dore ainsi que l\'opacit de la bire.   Le collet d\'une belle mousse blanche colle aux parois du verre. Au nez, elle prsente des notes de fruit de la passion, d\'ananas, de carambole ainsi que de pamplemousse. En bouche, on remarque la texture soyeuse, la petite pointe amre du pamplemousse, le zeste d\'orange, les pches, l\'ananas, le cantaloup ainsi que le ct juteux de la mangue.', 'Notre produit vedette: une IPA du Nord-Est pour avoir l\'impression d\'tre dans les tropiques. Des tonnes de houblons ont t rpartis dans deux houblonnages  cru ce qui confre le nez de fruits tropicaux caractristique  la Hazy. Au moment de verser cette IPA du Nord-Est, on remarque tout de suite la couleur dore ainsi que l\'opacit de la bire.   Le collet d\'une belle mousse blanche colle aux parois du verre. Au nez, elle prsente des notes de fruit de la passion, d\'ananas, de carambole ainsi que de pamplemousse. En bouche, on remarque la texture soyeuse, la petite pointe amre du pamplemousse, le zeste d\'orange, les pches, l\'ananas, le cantaloup ainsi que le ct juteux de la mangue.', 1, '2023-12-01 13:03:50', '2023-12-01 13:03:50'),
(480, 599, 'Double New England IPA', 'Double New England IPA', 1, '2023-12-01 13:04:54', '2023-12-01 13:04:54'),
(481, 600, 'IPA amricaine. De couleur cuivre, lgrement amre, elle se distingue par des armes et des saveurs florales et fruites intenses, issus d\'une combinaison de houblon amricain et australien. En plus de la charge colossale de houblon, une excellente dose de malt est galement prsente, gnrant un quilibre qui plat et stimule la prochaine gorge.', 'IPA amricaine. De couleur cuivre, lgrement amre, elle se distingue par des armes et des saveurs florales et fruites intenses, issus d\'une combinaison de houblon amricain et australien. En plus de la charge colossale de houblon, une excellente dose de malt est galement prsente, gnrant un quilibre qui plat et stimule la prochaine gorge.', 1, '2023-12-01 13:05:45', '2023-12-01 13:05:45'),
(482, 601, 'Une bire facile  boire, mais galement trs rafrachissante. On y retrouve des armes de houblon accompagns de notes d\'agrumes et de fruits tropicaux.', 'Une bire facile  boire, mais galement trs rafrachissante. On y retrouve des armes de houblon accompagns de notes d\'agrumes et de fruits tropicaux.', 1, '2023-12-01 13:07:41', '2023-12-01 13:07:41'),
(483, 602, 'Une American Ale, parfaite pour vous initier au monde de la microbrasserie avec son ct malt et lgrement grill doux. Vous y retrouverez des armes rafrachissants de zeste d\'orange et de poire bergamote.', 'Une American Ale, parfaite pour vous initier au monde de la microbrasserie avec son ct malt et lgrement grill doux. Vous y retrouverez des armes rafrachissants de zeste d\'orange et de poire bergamote.', 1, '2023-12-01 13:08:42', '2023-12-01 13:08:42'),
(484, 603, 'Sre  la mangue', 'Sre  la mangue', 1, '2023-12-01 13:09:40', '2023-12-01 13:09:40'),
(485, 604, 'Double New England IPA aux houblons Azacca, El Dorado et Galaxy.', 'Double New England IPA aux houblons Azacca, El Dorado et Galaxy.', 1, '2023-12-01 14:15:28', '2023-12-01 14:15:28'),
(486, 605, 'Notre OneLove prsente une robe de couleur cuivre. Le col de la bire saccroche au verre. Au nez on dcle des notes de rsine, dorange et de pamplemousse. En bouche, on retrouve ces mmes notes supportes par le ct rti des malts. La finale nous permet dapprcier une IPA impriale de la Cte Ouest qui est un quilibre parfait entre les malts et les houblons.', 'Notre OneLove prsente une robe de couleur cuivre. Le col de la bire saccroche au verre. Au nez on dcle des notes de rsine, dorange et de pamplemousse. En bouche, on retrouve ces mmes notes supportes par le ct rti des malts. La finale nous permet dapprcier une IPA impriale de la Cte Ouest qui est un quilibre parfait entre les malts et les houblons.', 1, '2023-12-01 14:18:20', '2023-12-01 14:18:20'),
(487, 606, 'Bire sre  la pche et aux jalapeos', 'Bire sre  la pche et aux jalapeos', 1, '2023-12-01 14:19:24', '2023-12-01 14:19:24');
